attrs.description:
Разработка конструкторской документации. 
Обсуждение проекта с заказчиком; 
Тщательное изучение существующих продуктов и всей доступной информации о них (3D-модели, тех. документация, чертежи); 
Разработка концепции и ее перенос в формат эскизов; 
создание 3D-модели.

Состав полного дизайн-проекта:
— общие данные, ведомость чертежей, ведомость отделки помещений;
— обмерный чертеж объекта 
— план расстановки мебели и оборудования;
— план демонтажа перегородок 
— план возводимых перегородок с маркировкой оконных и дверных проёмов;
— план потолка с указанием типа используемого материала, отдельных узлов и сечений;
— план размещения осветительных приборов, привязка выпусков освещения;
— план привязки выключателей с указанием включения групп светильников;
— план полов с указанием типа напольных покрытий и их площадей;
— план размещения сантехнического оборудования
— развёртки стен, в том числе с раскладкой кафельной плитки и указанием размеров;
— чертежи заказных изделий (при необходимости);
— 3D-визуализации помещений;
— спецификация основного оборудования, мебели, изделий, дверных проёмов и полотен.
Проект передается Вам в виде альбома.

